// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "./common/BasicStruct.sol";
import "./SwapInterfaces.sol";

interface IBoboRouter {
    function getBaseAmountOut(address inToken, address outToken, uint256 amountIn) external view returns(uint256 amountOut);
    function swap(address _inToken, address _outToken, uint256 _amountIn, uint256 _minAmountOut, address _orderOwner) external;  // uint256 totalAmountOut, 
}

interface IBoboPair {
    function baseToken() view external returns(address);
    function executeSpecifiedOrder(address _boboRouter, uint256 _orderId, uint256 _amountIn) external;
    function getTotalOrderNumber(bool _bBuy) view external returns(uint256);
    function getHeaderOrderIndex(bool _bBuy) view external returns(bool exist, uint256 index);
    function getOrderInfos(bool _bBuy, uint256 _fromIndex, uint256 _toIndex) view external returns(OrderInfo[] memory orderInfos);
    function swapTokensForExactTokens(uint256 _orderId, uint256 _outTokenAmountSwapIn) external returns(uint256);
    function getMaxOutAmountExpected(uint256 _orderId) view external returns(uint256);
}

interface IBoboFactory {
    function getPair(address tokenA, address tokenB) view external returns(address);
}

contract BoboRouterEx is Ownable {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.AddressSet;

    IBoboRouter public boboRouter;
    IBoboFactory public boboFactory;
    IBoboPair public boboPair;
    ERC20 public inToken;
    ERC20 public outToken;

    constructor(address _boboFactory, address _boboRouter) public {
        boboFactory = IBoboFactory(_boboFactory);
        boboRouter = IBoboRouter(_boboRouter);
    }

    function getBaseAmountOut(address _inToken, address _outToken, uint256 _amountIn) public view returns(uint256 amountOut) {

    }

    // 用户下市价单时，从pair调用到此接口，此接口先处理挂单，如还有剩余token未成交，再调用BoboRouter接口，让其同AMM进行交易
    function swap(ERC20 _inToken, ERC20 _outToken, uint256 _amountIn, uint256 _maxAmountOut, uint256 _minAmountOut, address _orderOwner) public {
        inToken = _inToken;
        outToken = _outToken;

        _inToken.transferFrom(msg.sender, address(this), _amountIn);

        address boboPairAddr = boboFactory.getPair(address(_inToken), address(_outToken));
        boboPair = IBoboPair(boboPairAddr);

        (uint256 leftAmountIn, uint256 swappedOutTokenAmount) = batchMatchOrders(_amountIn, _minAmountOut);

        // 兑换的token数已满足最低要求
        if (swappedOutTokenAmount >= _minAmountOut) {
            swappedOutTokenAmount = swappedOutTokenAmount > _maxAmountOut ? _maxAmountOut : swappedOutTokenAmount;
            IERC20(_outToken).transfer(msg.sender, swappedOutTokenAmount);
        } else {   // 通过AMM兑换剩余资产
            require(leftAmountIn > 0, "BoboRotuerEx: left amountIn should be > 0.");
            IERC20(_inToken).approve(address(boboRouter), leftAmountIn);

            uint256 outTokenAmount = IERC20(_outToken).balanceOf(address(this));
            boboRouter.swap(address(_inToken), address(_outToken), leftAmountIn, _minAmountOut.sub(swappedOutTokenAmount), _orderOwner);
            uint256 amountOutByAMM = ERC20(_outToken).balanceOf(address(this)).sub(outTokenAmount); 
            swappedOutTokenAmount = swappedOutTokenAmount.add(amountOutByAMM);

            require(swappedOutTokenAmount >= _minAmountOut, "BoboRotuerEx: can NOT take enough out token.");
            swappedOutTokenAmount = swappedOutTokenAmount > _maxAmountOut ? _maxAmountOut : swappedOutTokenAmount;
            IERC20(_outToken).transfer(msg.sender, swappedOutTokenAmount);
        }
    }

    function batchMatchOrders(uint256 _amountIn, uint256 _minAmountOut) private returns(uint256, uint256) {
        address baseToken = boboPair.baseToken();
        bool bBuyQuoteToken = address(baseToken) == address(inToken);   // true: 表示要swap的订单是买单，需要找卖单匹配  false: 表示swap的订单是卖单，需要找卖单匹配
        uint256 quoteTokenDecimals = bBuyQuoteToken ? outToken.decimals() : inToken.decimals();
        uint256 spotPrice = bBuyQuoteToken ? _amountIn.mul(10**quoteTokenDecimals).div(_minAmountOut) 
                                           : _minAmountOut.mul(10**quoteTokenDecimals).div(_amountIn);

        uint256 orderNumber = boboPair.getTotalOrderNumber(!bBuyQuoteToken);
        uint256 leftAmountIn = _amountIn;   // 剩余可兑换的资金
        uint256 swappedOutTokenAmount = 0;  // 被兑换出来的资金
        for (uint256 fromIndex = 0; fromIndex < orderNumber; fromIndex += 1) {            
            OrderInfo[] memory orderInfos = boboPair.getOrderInfos(!bBuyQuoteToken, fromIndex, fromIndex + 1);

            if ((bBuyQuoteToken && spotPrice >= orderInfos[0].spotPrice) || (!bBuyQuoteToken && spotPrice <= orderInfos[0].spotPrice)) {  // 匹配价格满足条件的挂单
                (uint256 onceSwappedInTokenAmount, uint256 onceSwappedOutTokenAmount) = matchOrder(orderInfos[0], leftAmountIn);
                leftAmountIn = leftAmountIn.sub(onceSwappedInTokenAmount);
                swappedOutTokenAmount = swappedOutTokenAmount.add(onceSwappedOutTokenAmount);
                if (swappedOutTokenAmount >= _minAmountOut || leftAmountIn == 0) {
                    break;
                }
            } else {
                break;
            }
        }
        return (leftAmountIn, swappedOutTokenAmount);
    }

    function matchOrder(OrderInfo memory orderInfo, uint256 leftAmountIn) private returns(uint256, uint256) {                            
        uint256 maxOutAmountExpected = boboPair.getMaxOutAmountExpected(orderInfo.id);
        uint256 preInTokenBalance = inToken.balanceOf(address(this));
        uint256 preSwappedOutTokenAmount = outToken.balanceOf(address(this));

        if (leftAmountIn >= maxOutAmountExpected) {  // 输入的inToken数量满足卖单所需，可以完全吃掉此订单
            inToken.approve(address(boboPair), maxOutAmountExpected);
            boboPair.swapTokensForExactTokens(orderInfo.id, maxOutAmountExpected);
        } else {  // 无法完全吃掉此订单，只能吃一部分
            inToken.approve(address(boboPair), leftAmountIn);
            boboPair.swapTokensForExactTokens(orderInfo.id, leftAmountIn);
        }

        uint256 newSwappedOutTokenAmount = outToken.balanceOf(address(this));   // 兑换后本合约总的outToken
        uint256 swappedOutTokenBalance = newSwappedOutTokenAmount.sub(preSwappedOutTokenAmount);  // 兑换出来的token

        uint256 newInTokenBalance = inToken.balanceOf(address(this));  // 兑换后剩余的inToken
        uint256 swappedInTokenBalance = newInTokenBalance.sub(preInTokenBalance);   // 兑换进去的token

        return (swappedInTokenBalance, swappedOutTokenBalance);
    }

    function withdrawToken(address _tokenAddr) public onlyOwner {
        ERC20(_tokenAddr).transfer(msg.sender, ERC20(_tokenAddr).balanceOf(address(this)));
    }
}
